INSERT INTO ROOM (RATING, CREATED_AT, LOCATION_ID, MODIFIED_AT, PRICE, THEME_ID, ADDRESS, DESCRIPTION, LOCATIONX, LOCATIONY, NAME)VALUES
(0.0, '2023-11-29 23:19:51.742405', 10, '2023-11-29 23:19:51.742405', 80000, 1, '전북 전주시 덕진구 금암동 710-16,전북 전주시 덕진구 금암동 710-16', '리옹 중심부에서 여러분을 맞이하기 위해 양질의 자재로 리노베이션된 아파트의 개인 욕실을 갖춘 객실입니다. 신화 속 크루아 루스 언덕에서 발견할 수 있는 멋진 놀라움이 여러분을 기다리고 있습니다. 푸르른 분위기의 조용하고 매력적인 숙소: 진정한 럭셔리. 그리고 리옹에게는 탁월합니다. 주차장은 매우 쉽게 찾을 수 있습니다. 😊', 127.13124498299196, 35.839275388770126, '전용 정원, 조용하고 편리한 주차 공간');
